    "2016-05-25T00:43:38.320204",nt"name": "delphi-transaction-file-dtf",nt"isopen":
    true,nt"url": null,nt"notes": "Repository of Delphi Data made available
    to other FAA Systems.The FAA implemented the Department of Transportation's (DOT)
    new financial accounting system, DELPHI, in November 2003.  In addition to its other
    functions, the DELPHI system provides various extracts of financial data on a daily
    basis to the various DOT agencies for use by downstream applications.  These extracts
    include the DTF and a number of supporting data files.The DTF System serves as a
    centralized repository of historical financial information for the FAA which facilitates
    more efficient processing on the part of downstream financial systems.  ABA-20 determined
    that the most effective way to provide budget, financial, and performance management
    was to create a centralized database server to collect, interpret, validate, and
    stage the data rather than requiring each downstream financial system to perform
    these duplicate tasks.",nt"license_title": "Other License Specified",nt"extras":
